import React from 'react';
import AnimatedProgressBarWithText from '../animated/animated-progress-bar-with-text';

const SkillWithText = ({ text, numberToIncrementTo }) => (
    <AnimatedProgressBarWithText
      text={text}
      numberToIncrementTo={numberToIncrementTo}
    />
);

export default SkillWithText;
